import '../App.css';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import logo from '../images/hand-book-logo-illustration-art-background-43965136.webp';

const Home = () => {
  return (
    <div className='home'>
        <img className='homeLogo' src={logo} alt='library logo'/>
        <div className='homeFirstDiv'>
            <h1>WELCOME TO LIBRARY</h1>
            <div className='homeFirstDiv_childFirstDiv'>
            <div><TextField className='textfield' id="outlined-basic" label="Email" variant="outlined" /></div>

            <Button variant="contained">Sign-In</Button>
            </div>
            <div><i>OR</i></div>
            <Button variant="contained">Sign-Up</Button>
        </div>
    </div>
  )
}

export default Home
